Templates.template:
fireDataPointsSelected(
	{
		dataContext: ${dataContext} // object
	}
)

fireSelectionDetailsActionPressed(
	{
		action: ${action}, // sap.ui.core.Item
		itemContexts: ${itemContexts}, // sap.ui.model.Context
		level: ${level} // sap.m.SelectionDetailsActionLevel
	}
)

fireDataPointsSelected(
	{
		dataContext: ${dataContext} // object
	}
)

fireInnerChartLoadedData(
	{
		innerChart: ${innerChart} // sap.core.Control
	}
)

fireSelectionDetailsActionPressed(
	{
		action: ${action}, // sap.ui.core.Item
		itemContexts: ${itemContexts}, // sap.ui.model.Context
		level: ${level} // sap.m.SelectionDetailsActionLevel
	}
)

fireChange(
	{
		value: "${value}", // string
		valid: ${bValid}, // boolean
		promise: ${promise} // Promise
	}
)

fireChange(
	{
		value: "${value}", // string
		valid: ${bValid}, // boolean
		conditions: [${conditions}], // object[]
		promise: ${bPromise} // boolean
	}
)

new sap.ui.mdc.Link(
	"${sId}", // string
	{
		enablePersonalization: ${bEnablePersonalization}, // boolean
		delegate: ${"...see text or source"}, // object
		sourceControl: ${sourceControl} // (sap.ui.core.Control|string)
	}
)

new sap.ui.mdc.condition.RangeOperator(
	{
		label: "${label}", // string
		calcRange: ${fn_calcRange}, // function
		formatRange: ${fn_formatRange} // function
	}
)

new sap.ui.mdc.field.CustomFieldInfo(
	"${sId}", // string
	{
		content: ${content} // sap.ui.core.Control
	}
)

fireLiveChange(
	{
		value: "${value}", // string
		escPressed: ${bEscPressed}, // boolean
		previousValue: "${previousValue}" // string
	}
)

fireSubmit(
	{
		promise: ${promise} // Promise
	}
)

fireNavigate(
	{
		value: ${value}, // any
		key: ${key}, // any
		condition: ${condition}, // object
		itemId: "${itemId}" // string
	}
)

fireSelect(
	{
		conditions: [${conditions}], // object[]
		add: ${bAdd}, // boolean
		close: ${bClose} // boolean
	}
)

fireDataUpdate(
	{
		contentChange: ${bContentChange} // boolean
	}
)

fireNavigate(
	{
		key: ${key}, // any
		description: "${description}", // string
		leave: ${bLeave}, // boolean
		disableFocus: ${bDisableFocus}, // boolean
		itemId: "${itemId}" // string
	}
)

fireSelectionChange(
	{
		selectedItems: [${selectedItems}], // object[]
		itemPress: ${bItemPress} // boolean
	}
)

new sap.ui.mdc.field.FieldValueHelpMTableWrapper(
	"${sId}", // string
	{
		table: ${table} // sap.m.Table
	}
)

new sap.ui.mdc.field.FieldValueHelpMdcTableWrapper(
	"${sId}", // string
	{
		table: ${table} // sap.ui.mdc.Table
	}
)

new sap.ui.mdc.field.FieldValueHelpUITableWrapper(
	"${sId}", // string
	{
		table: ${table} // sap.ui.table.Table
	}
)

fireSelect(
	{
		key: "${key}" // string
	}
)

createChanges(
	{
		control: ${control}, // sap.ui.mdc.Control
		key: "${key}", // string
		state: ${state}, // object
		applyAbsolute: ${bApplyAbsolute}, // boolean
		suppressAppliance: ${bSuppressAppliance} // boolean
	}
)
